import React, { Component } from 'react';
import './App.css';

function SubmitButton(){
    return (
      <div className="textbox-holder">
          <textarea placeholder="Enter text to be summarised here" rows="4" cols="50">
            Enter text to be summarised here
          </textarea>
      </div>
    );
}

export default SubmitButton;
